import { renderToString } from "react-dom/server";
import { shell } from "~/routes/$.tsx";


let cache: string;
export function PhpResponse() {
	if (cache) return cache;

	cache = renderToString(shell(<div style={{ position: "fixed", inset: 0, display: "flex", alignItems: "center", justifyContent: "center" }}>
		<div style={{ display: "flex", flexDirection: "column", gap: "5px" }}>
			<div style={{
				backgroundImage: "url('data:image/gif;base64,')",
				aspectRatio: "1",
				backgroundRepeat: "no-repeat",
				backgroundPosition: "center",
				backgroundSize: "contain"
			}}></div>
			<div style={{ fontSize: "3rem" }} className="text-center">This is <b>not</b> a PHP Website</div>
		</div>

	</div>, { headless: true }));

	return cache;
}